import Dashboard from './components/Dashboard/Dashboard'
import { MuiThemeProvider, createMuiTheme } from '@material-ui/core/styles';

const theme = createMuiTheme({
  palette: {
    secondary: {
      main: '#E33E7F'
    }
  }
});

function App() {
  return (
    <div>
      <MuiThemeProvider theme={theme}>
        <Dashboard />
      </MuiThemeProvider>
    </div>
  );
}

export default App;
